import React from 'react';
import { Link } from 'react-router-dom';

class App extends React.Component {

  render() {
    return (
      <div className="App">
        <h1>Home</h1>
        <ul>
          <li><Link to="/System">System</Link></li>
          <li><Link to="/Lecture">Lecture</Link></li>
        </ul>
      </div>
    )
  }
}

export default App;
